import ProductCard from './ProductCard';
import './Products.css';
import iqooImage from'../assets/Iqoo.jpg';
import iPhone from '../assets/iphone.jpg';
import nothing from '../assets/N3A.jpg';
import pixel from '../assets/pixel.png';

function Products() {
    return (<>
        <section className="container-fluid mt-3">
            <div className="row">

                {/* img using assets */}
               <ProductCard/>

                {/* img using public */}
                <ProductCard/>

                <div className="col-3">
                    <div className="card" >
                        <img className="card-img-top" src={pixel} alt="" />
                        <div className="card-body">
                            <h3 className="card-title">Google Pixel</h3>
                            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Laudantium eum cum odio </p>
                            <button className="btn btn-warning">Buy now</button>
                        </div>
                    </div>
                </div>

                <div className="col-3">
                    <div className="card" >
                        <img className="card-img-top" src={nothing} alt="" />
                        <div className="card-body">
                            <h3 className="card-title">Nothing Phone 3a</h3>
                            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Laudantium eum cum odio </p>
                            <button className="btn btn-warning">Buy now</button>
                        </div>
                    </div>
                </div>
            </div>
        </section>
    </>);
}
export default Products;
